      SELECT DISTINCT + col1 * - col2 * + col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN ( - col1 + col1 * col0 ) AND col2 * + col1;
  - name: tab1

outputs:
  - name: q6344.out
    data: |
